import React from 'react';
import styled from 'styled-components'

const Header = () => {
    return (
        <HeaderContainer>

        <HeaderImg>
            <img src='./images/header-pic2.jpg' alt='Header Image. Photo by <a href="https://unsplash.com/de/@towfiqu999999?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Towfiqu barbhuiya</a> on <a href="https://unsplash.com/photos/n-7HTOiJPso?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Unsplash</a>'/>
        </HeaderImg>

        <TopContainer>
            <NavbarContainer>
            <LogoContainer>
                <img src='./images/Logo.png' alt='twokay logo' />	
            </LogoContainer>
            <NavContainer>
                <nav>
                    <ul className="navlist">
                        <li><a href="#">Home</a></li>
                        <li><a href="#">Products</a></li>
                        <li><a href="#">Blog</a></li>
                        <li><a href="#">About</a></li>
                        <li><a href="#">Contact Us</a></li>
                    </ul>
                </nav>

            </NavContainer>
            </NavbarContainer>

        </TopContainer>

        
        </HeaderContainer>
    )
};

const HeaderContainer = styled.div`

`
const HeaderImg = styled.div`
max-width: 100vw;
height: 650px;

img {
    width:100%;
    height:100%;
    object-fit:cover;
}

`
const TopContainer = styled.div`
position: absolute;
top:0;
width: 100%;

`
const NavbarContainer = styled.div`
display:flex;
flex-direction: row;
justify-content: space-between;


/* Navbar Styles */
.navlist {
  list-style-type: none;
  margin: 0;
  padding: 0;
  background-color: transparent;
}

.navlist li {
  display: inline-block;
}

.navlist li a {
  font-family: 'Poppins', sans-serif;
  font-weight: 400;
  font-size: 20px;
  line-height: 2;
  display: block;
  color: #111;
  text-align: center;
  padding: 14px 16px;
  text-decoration: none;
}

.navlist li a:hover {
  opacity: 0.5;

}

`
const NavContainer = styled.div`

`
const LogoContainer = styled.div`

img {
    background: transparent;
}

`
export default Header;
